import React from 'react';
import ImageHover from '../src/ImageHover';

const ImageChange = () => {
    return (  
        <div>
            <ImageHover primaryImg={"/static/image1.png"} alt={"image_1"} width="450"/>
                     &nbsp; &nbsp; &nbsp;
            <ImageHover primaryImg={"static/image2.png"} alt={"image_1"} width="400"/>
        </div>
    );
}

export default ImageChange;
